import './App.css';
import HeaderNav from './components/HeaderNav';
import CertificateTable from './components/CertificateTable';
import Addform from './components/Form';

import Pagination from './components/Pagination';

function App() {
  return (
    <div>
      <header>
      <HeaderNav />
      </header>
       <body>
         <br />
        <CertificateTable />
        <Addform/>
        <Pagination />
       </body>

    </div>

  );
}

export default App;
